import { TwoBitDrawing } from "./twobitdrawing.js";
import { PaletteSlider } from "./paletteslider.js";
import { TwoBitCanvas } from "./twobitcanvas.js";
const TEMPLATE = document.createElement('template');
TEMPLATE.innerHTML = `
<style>
  div {
    width: 50%;
  }
  two-bit-canvas {
    width: 100%;
  }
</style>
<div>
  <!--two-bit-drawing width="160" height="144"></two-bit-drawing-->
  <two-bit-canvas width="160" height="144"></two-bit-canvas>
  <palette-slider></palette-slider>
</div>
`;

//const kData = '';
//const kData = '';
const kData = '';

export class BigPaletteAnimation extends HTMLElement {
  constructor() {
    super();

    const shadow = this.attachShadow({ mode: 'open' });
    shadow.appendChild(TEMPLATE.content.cloneNode(true));
  }

  connectedCallback() {
    //const drawing = this.shadowRoot.querySelector('two-bit-drawing');
    const canvas = this.shadowRoot.querySelector('two-bit-canvas');
    /*drawing.twoBitCanvas*/canvas.setTwoBitDataFromB64(kData);
    const slider = this.shadowRoot.querySelector('palette-slider');
    slider.addEventListener('palette-change', (ev) => {
      /*drawing.twoBitCanvas*/canvas.colours = ev.detail;
      /*drawing.twoBitCanvas*/canvas.redrawCanvas();
    });
  }
}
customElements.define('big-palette-animation', BigPaletteAnimation);